// DiscordStatus.js (versión mejorada)
import { useState, useEffect } from 'react';
import '../styles/DiscordStatus.css';

const spotifyPlaylist = [ /* tu lista ya está bien */ ];

function DiscordStatus() {
  const [, setCurrentTrack] = useState(0);

  const [user, setUser] = useState({
    discord_user: {
      username: 'poncho_ajmv',
      tag: '@poncho_ajmv',
      avatar: 'https://i.imgur.com/O3Lulcc.jpeg'
    },
    discord_status: 'online',
    listening_to_spotify: true,
    spotify: spotifyPlaylist[0],
    activities: [
      {
        name: 'Visual Studio Code',
        type: 0
      }
    ],
    joined_at: 'Apr 10, 2017',
    roles: ['Linux', 'React', 'Ciberseguridad', 'Frontend', 'CLI', 'Terminal UI'],
    note: 'I am one with the Force and the Force is with me.'
  });

  useEffect(() => {
    const interval = setInterval(() => {
      const randomIndex = Math.floor(Math.random() * spotifyPlaylist.length);
      setCurrentTrack(randomIndex);
      setUser(prevUser => ({
        ...prevUser,
        spotify: spotifyPlaylist[randomIndex]
      }));
    }, 5000);
    return () => clearInterval(interval);
  }, []);

  return (
    <section className="discord-profile">
      <div className="banner-gif"></div>
      <div className="profile-container">
        <img className="avatar" src={user.discord_user.avatar} alt="avatar" />
        <div className={`status-dot ${user.discord_status}`}></div>
        <div className="profile-info">
          <h3 style={{ marginTop: '5rem' }}>{user.discord_user.username}</h3>
          <p className="tag">{user.discord_user.tag}</p>

          {user.activities.length > 0 && (
            <p className="playing">🎮 Playing <strong>{user.activities[0].name}</strong></p>
          )}

          {user.listening_to_spotify && (
            <div className="spotify-widget fade-in">
              <img src={user.spotify.album_art_url} alt="album art" className="album-art" />
              <div className="song-info">
                <p className="song">{user.spotify.song}</p>
                <p className="artist">{user.spotify.artist}</p>
              </div>
            </div>
          )}

          <div className="about-me">
            <p><strong>ABOUT ME</strong></p>
            <p>Systems Engineering Student</p>
            <p>🐧 Linux lover | 🌐 Frontend Dev | 🛡️ Cibersecurity Enthusiast</p>
            <p>✨ Star Wars fan — "Do or do not. There is no try."</p>
            <p className="external-link">
              🔗 <a href="https://github.com/poncho-ajmv" target="_blank" rel="noreferrer">github.com/poncho-ajmv</a>
            </p>
            <ul className="bullets">
              <li>Beginner Developer</li>
              <li>I Love Cybersecurity</li>
              <li>Open Source Advocate</li>
            </ul>
          </div>

          <div className="extra-info">
            <p><strong>MEMBER SINCE</strong></p>
            <p className="joined">🗓️ {user.joined_at}</p>

            <p><strong>ROLES</strong></p>
            <div className="roles">
              {user.roles.map((role, i) => (
                <span className={`role-pill color-${i % 2}`} key={i}>{role}</span>
              ))}
            </div>

            <p><strong>NOTE</strong></p>
            <p className="note">{user.note}</p>

            <form action="https://discord.com/users/957722095381540874" method="get" target="_blank" className="message-box">
              <input type="text" placeholder={`Message ${user.discord_user.tag}`} />
              <button type="submit" aria-label="Send">
                <svg xmlns="http://www.w3.org/2000/svg" height="16" width="16" viewBox="0 0 24 24" fill="currentColor">
                  <path d="M2 21l21-9L2 3v7l15 2-15 2v7z" />
                </svg>
              </button>
            </form>
          </div>
        </div>
      </div>
    </section>
  );
}

export default DiscordStatus;
